import React from "react"

function Footer() {
    return (
        <footer>
            <div className="footerLinks">
                <img src="https://image.flaticon.com/icons/png/512/25/25231.png" alt="GitHub Logo"></img>
                <p>Created by <a target="_blank" href="https://twitter.com/SpencerLepine">@SpencerLepine</a></p>
                <img src="https://logodownload.org/wp-content/uploads/2014/09/twitter-logo-1-1.png" alt="GitHub Logo"></img>
            </div>
        </footer>
    )
}

export default Footer
